import React from 'react'
import './index.css'

export const Card = () => {
  return (
	<div className='contaibner_card'>
		<div>
			<img src='https://legkovmeste.ru/wp-content/uploads/2019/02/post_5c54406d90bda.jpg' width='150px'/>
			<h1>Название чебурека</h1>
		</div>
	</div>
  )
}
